// SPDX-License-Identifier: MIT
pragma solidity 0.8.9;

import './EarlyBirds.sol';
import './Wormies.sol';


contract EarlyBirdsFactory{
  EarlyBirds[] public campaignsCreated;

  function create() public
  returns(EarlyBirds){
    Wormies wrms = new Wormies();
    EarlyBirds ebs = new EarlyBirds(address(wrms));
    campaignsCreated.push(ebs);
    return(ebs);
  }

}
